export default function TravelCard(props) {
    return (
        <h1>
            Travel Card
        </h1>
    );
}

function cardHeader(location, title) {
    return (
        <>
            <img src={locationMarker} alt=''></img>
            <p>{location}</p>
            <a>View on google maps</a>
            <h2>{title}</h2>

        </>
    );
}
